Amugy felmer&uuml;lt bennem az a k&eacute;rd&eacute;s hogy ha kifullozom a 100-as szintet &eacute;s minden hős megvan, de a 3 esszencia ikon &eacute;s az urfwick-et nem tudn&aacute;m kivenni mert 100 as vagyok &eacute;s nem kapok kapszul&aacute;t. Mondjuk az a mennyis&eacute;g ami megmaradt amikor m&aacute;r mindenhős megvan &eacute;s mondjuk csak az urfwicket tudn&aacute;m kivenni a 5 emote-ot nem tudn&aacute;m kivenni.(Dől a lé, Pénzeszsákok, Dragakőlovag, Drágakő herceg, Drágakőkirálya)
